class RibbonClipper extends CustomClipper<Path> {
  @override
  Path getClip(Size size) {
    final Path path = Path();
    path.lineTo(0, size.height * 0.7); // Go to 70% height
    path.lineTo(size.width / 2, size.height); // Create a triangle point
    path.lineTo(size.width, size.height * 0.7); // Go back to the other side
    path.lineTo(size.width, 0); // Close at the top-right corner
    path.close();
    return path;
  }

  @override
  bool shouldReclip(CustomClipper<Path> oldClipper) => false;
}
